// Helper: Setup Dokumen PDF
const createPDFDoc = (landscape = false) => {
  if (!window.jspdf) {
    alert("Library PDF error! Refresh halaman.");
    return null;
  }
  return new window.jspdf.jsPDF(landscape ? "l" : "p", "mm", "a4");
};

